import json
import dill

from fastapi.testclient import TestClient

from pyciemss_api.main import api


client = TestClient(api)


def test_compile():
    compile_content = json.dumps(
        {
            "petrinet": {"S": [{"sname": "S", "mira_ids": "[('identity', 'ido:0000515')]", "mira_context": "[('vaccination_status', 'vo:0001377')]"}, {"sname": "I", "mira_ids": "[('identity', 'ido:0000511')]", "mira_context": "[]"}, {"sname": "Iv", "mira_ids": "[('identity', 'ido:0000511')]", "mira_context": "[('vaccination_status', 'ncit:C28385')]"}, {"sname": "V", "mira_ids": "[('identity', 'ido:0000514')]", "mira_context": "[('vaccination_status', 'vo:0001376')]"}, {"sname": "R", "mira_ids": "[('identity', 'ido:0000592')]", "mira_context": "[]"}], "T": [{"tname": "SI_flux", "template_type": "ControlledConversion", "parameter_name": "betaSI", "parameter_value": 1.0}, {"tname": "SIv_flux", "template_type": "ControlledConversion", "parameter_name": "betaSIv", "parameter_value": 1.0}, {"tname": "SV_flux", "template_type": "NaturalConversion", "parameter_name": "nu", "parameter_value": 1.0}, {"tname": "VI_flux", "template_type": "ControlledConversion", "parameter_name": "betaVI", "parameter_value": 1.0}, {"tname": "VIv_flux", "template_type": "ControlledConversion", "parameter_name": "betaVIv", "parameter_value": 1.0}, {"tname": "IR_flux", "template_type": "NaturalConversion", "parameter_name": "gamma", "parameter_value": 1.0}, {"tname": "IvR_flux", "template_type": "NaturalConversion", "parameter_name": "gammaV", "parameter_value": 1.0}], "I": [{"is": 1, "it": 1}, {"is": 1, "it": 2}, {"is": 1, "it": 3}, {"is": 2, "it": 1}, {"is": 2, "it": 4}, {"is": 2, "it": 6}, {"is": 3, "it": 2}, {"is": 3, "it": 5}, {"is": 3, "it": 7}, {"is": 4, "it": 4}, {"is": 4, "it": 5}], "O": [{"os": 2, "ot": 1}, {"os": 2, "ot": 1}, {"os": 3, "ot": 2}, {"os": 2, "ot": 2}, {"os": 4, "ot": 3}, {"os": 2, "ot": 4}, {"os": 3, "ot": 4}, {"os": 3, "ot": 5}, {"os": 3, "ot": 5}, {"os": 5, "ot": 6}, {"os": 5, "ot": 7}]},
            "priors": {
                "noise_var" : ["Uniform", 5.0, 10.0],
                "betaSI"    : ["Uniform", 0.1, 0.3], 
                "betaSIv"   : ["Uniform", 0.1, 0.3], 
                "betaVI"    : ["Uniform", 0.025, 0.05],
                "betaVIv"   : ["Uniform", 0.025, 0.05],
                "gamma"     : ["Uniform", 0.05, 0.35],
                "gammaV"    : ["Uniform", 0.1, 0.4],
                "nu"        : ["Uniform", 0.001, 0.01]
            }
        }
    )
    response = client.post("/compile", content=compile_content)
    result = response.json()
    assert isinstance(result, dict) and 'ode_model' in result, "Result is well formed"
    ode_model = dill.loads(bytes.fromhex(result['ode_model']))
    assert ode_model.__class__.__name__ == 'PyroODE', 'Model can be reified'


def test_sample():
    SAMPLE_COUNT = 8
    sample_content = json.dumps(
        {
            "ode_model": "",
            "num_samples": SAMPLE_COUNT,
            "initial_state": [
                0.1,
                0,
                0.4433,
                0.0,
                1.2
            ],
            "tspan": {
                "start": 0,
                "end": 20,
                "step": 1
            }
        }
    )
    response = client.post("/sample", content=sample_content)
    result = response.json()
    assert isinstance(result, dict) and list(sorted(result.keys())) == ['I_obs', 'Iv_obs', 'R_obs', 'S_obs', 'V_obs', 'betaSI', 'betaSIv', 'betaVI', 'betaVIv', 'gamma', 'gammaV', 'noise_var', 'nu'], "Result is well formed"
    assert all((len(items) == SAMPLE_COUNT for items in result.values())), "Number of returned samples matches requested number"



def test_infer_parameters():
    infer_content = json.dumps(
        {
            "ode_model": "",
            "num_iterations": 2,
            "hidden_observations": ["S_obs", "V_obs", "Iv_obs", "R_obs"],
            "data": {
                "I_obs" : [81.47, 84.3, 86.44, 89.66, 93.32, 94.1, 96.31],
                "S_obs" : None,
                "V_obs" : None,
                "Iv_obs": None,
                "R_obs" : None
            },
            "initial_state": [
                0.1,
                0,
                0.4433,
                0.0,
                1.2
            ],
            "observed_tspan": {
                "start": 1,
                "end": 7,
                "step": 7
            }
        }
    )
    response = client.post("/infer_parameters", content=infer_content)
    assert response.status_code == 200, "API call returned successful"


